    summary: 기존 스트리밍 작업에서 기존 출력을 업데이트 합니다. 이 부분적으로 (즉 업데이트를 사용할 수 있습니다. 하나 또는 두 개의 속성 업데이트)는 rest 작업 또는 출력 정의 영향을 주지 않고 출력 합니다.
    syntax:
      content: 'function update(output: Output, resourceGroupName: string, jobName: string, outputName: string, options?: Models.OutputsUpdateOptionalParams)'
      parameters:
        - id: output
          type:
            - '@azure/arm-streamanalytics.Output'
          description: 출력 개체입니다. 여기에 지정 된 속성을 기존 출력 (즉 해당 속성을 덮어쓸 이러한 속성을 업데이트할). 기존 출력에서 해당 속성은 동일 하 게 유지 하 고이 패치 작업의 결과로 변경 되지 여기 null로 설정 된 속성 의미 합니다.
        - id: resourceGroupName
